var app={};app.init=function(){app.grids(),app.nav()},app.grids=function(){$(".grid").isotope({percentPosition:!0,itemSelector:".grid-item",masonry:{columnWidth:".grid-sizer",gutter:".gutter-sizer"}}),$(".filter-button-group").on("click","button",function(){var t=$(this).attr("data-filter");$(".grid").isotope({filter:t})})},app.nav=function(){$(".hamburger").click(function(t){$(this).toggleClass("close"),$("aside").toggleClass("open")})},$(function(){app.init(),console.log("It's working")});